// 假資料，之後可以從 MongoDB 獲取
const students = [
  { id: 1, name: "呱呱呱", department: "電機工程系", grade: "四年級", class: "A", email: "tkuee0787@tkuim.com" }
];

const StudentList = () => {
  return (
    <div className="form-container">
  <form>
    <input placeholder="帳號" />
    <input placeholder="姓名" />
    <button className="submit">新增</button>
    <button className="delete">刪除</button>
    <button className="cancel">取消</button>
  </form>
</div>
  );
};

export default StudentList;
